&lt;p&gt;&lt;strong&gt;Descripci&oacute;n:&nbsp;&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;&iexcl;A tu peque&ntilde;o le encantar&aacute; construir y reconstruir este simp&aacute;tico autob&uacute;s amarillo y se divertir&aacute; conduci&eacute;ndolo durante horas! Este sencillo set fomenta el desarrollo de las habilidades motrices y de construcci&oacute;n, mientras que los ladrillos con forma de ventanilla decorados con personajes invitan a inventar historias. Los ladrillos LEGO&reg; DUPLO&reg; est&aacute;n dise&ntilde;ados especialmente para proporcionar seguridad en las manos de los m&aacute;s peque&ntilde;os.&lt;/p&gt;
&lt;ul&gt;
&lt;li&gt;Tema: Duplo&lt;/li&gt;
&lt;li&gt;Contiene un autob&uacute;s para construir con ruedas.&lt;/li&gt;
&lt;li&gt;Incluye tambi&eacute;n ladrillos decorados por ambas caras con ventanas que muestran personajes como punto de partida para divertidas historias.&lt;/li&gt;
&lt;li&gt;A tu peque&ntilde;o le encantar&aacute; conducir este simp&aacute;tico autob&uacute;s amarillo por todas partes.&lt;/li&gt;
&lt;li&gt;Construye y reconstruye creando todo tipo de veh&iacute;culos distintos.&lt;/li&gt;
&lt;li&gt;Ayuda a tu hijo a desarrollar sus habilidades b&aacute;sicas de construcci&oacute;n con este sencillo modelo.&lt;/li&gt;
&lt;li&gt;Los productos LEGO&reg; DUPLO&reg; se dise&ntilde;an espec&iacute;ficamente para ser divertidos y f&aacute;ciles de usar en las manos de los m&aacute;s peque&ntilde;os.&lt;/li&gt;
&lt;li&gt;Este set proporciona una experiencia de construcci&oacute;n y juego apropiada para ni&ntilde;os de 18 meses a 3 a&ntilde;os.&lt;/li&gt;
&lt;li&gt;El autob&uacute;s mide m&aacute;s de 7 cm de altura, 9 cm de longitud y 6 cm de ancho.&lt;/li&gt;
&lt;li&gt;Edad: 1&frac12; - 3&lt;/li&gt;
&lt;li&gt;Piezas: 6&lt;/li&gt;
&lt;/ul&gt;
&lt;p&gt;&nbsp;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;T&eacute;rminos y condiciones:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;* Tienda Oficial de LEGO&reg;.&lt;/p&gt;
&lt;p&gt;* Garant&iacute;a: Sujetas a la marca.&lt;/p&gt;
&lt;p&gt;* Tiempo de entrega: De 6 a 10 d&iacute;as habiles a partir de la aprobaci&oacute;n del pago.&lt;/p&gt;
&lt;p&gt;* Valido hasta agotar existencias.&lt;/p&gt;
&lt;p&gt;* Unidades limitadas.&lt;/p&gt;
&lt;p&gt;* Precios sujetos a cambios sin previo aviso.&lt;/p&gt;

